  <style>
    img#logo, svg {
      width: 32px;
      margin-left: 12px;
      filter: drop-shadow(0px 0px .5px #fff);
      vertical-align: middle;
    }

    div#headerbar {
      font-size: 1.25em;
      color: #fff;
      padding-left: 12px;
      position: fixed;
      height: 64px;
      line-height: 64px;
      background-color: #24292e;
      z-index: 100;
      width: 100%;
    }

    div#headerbar > a:hover {
      color: #bebfc1;
    }

    a.github-corner, aside.sidebar, section.content {
      margin-top: 64px;
    }

    .sidebar {
      padding-top: 12px;
    }

    div.sidebar-nav > ul > li:first-child > a {
      font-size: 1.25em;
      text-decoration: underline;
      font-weight: bold;
    }

    div#headerbar > nav {
      display: contents;
    }

    ul.nav {
      position: absolute;
      right: 0px;
    }

    ul.dropdown {
      width: 140px;
    }

    ul.dropdown > li {
      color: #000;
    }

li {
 display: block;
 transition-duration: 0.5s;
}

ul.nav > li, ul.dropdown > li {
  padding: initial;
}

li:hover {
  cursor: pointer;
}

ul li ul {
  visibility: hidden;
  opacity: 0;
  position: absolute;
  transition: all 0.5s ease;
  margin-top: 1rem;
  left: 0;
  display: none;
}

ul li:hover > ul, ul li ul:hover {
  visibility: visible;
  opacity: 1;
  display: block;
}

ul li ul li {
  clear: both;
  width: 100%;
}

ul.nav > li > a, ul.dropdown > li > a {
  font-size: 14px;
  font-weight: 600;
  white-space: nowrap;
  text-decoration: none;
}
  </style>

  <script>
    window.$docsify = {
      name: '',
      repo: 'jsonx-org/jsonx',
      // basePath: '/jsonx/',
      // homepage: 'README.md',
      homepage: 'https://raw.githubusercontent.com/jsonx-org/jsonx/master/README.md',
      relativePath: true,
      alias: {
        "/(.*)/?": "https://raw.githubusercontent.com/jsonx-org/jsonx/master/$1/README.md"
      },
      markdown: {
        renderer: {
          link: function (href, title, text) {
            if (href.startsWith("http"))
              return '<a href="' + href + '">' + text + '</a>';

var hh = href;
            var d;
            for (d = 0; href.startsWith("../") || href.startsWith("/.."); ++d)
              href = href.substring(3);

            var rootPath = "/jsonx";
            var path = location.href.substring(location.href.indexOf('/', 8));
            var isRoot = path.startsWith("/#");
            if (isRoot)
              path = rootPath + path;

            var q = path.indexOf("?id=");
            if (q > -1)
              path = path.substring(0, q);

            if (path.endsWith("/"))
              path = path.substring(0, path.length - 1);

console.log(location.href + "\n" + path + " -> " + hh + " " + text);
var dd = d;
var pp = path;
            for (var s; (s = path.lastIndexOf('/')) != -1 && d > 0; --d) {
              var token = path.substring(s + 1);
              if (token === "#")
                --d;

              path = path.substring(0, s);
            }

            if (!path.endsWith('/'))
              path += "/";

            if (path.length > 1) {
              var s = path.indexOf('/', 2);
              if (s === -1)
                path += "#/";
              else if (path.charAt(s + 1) !== '#')
                path = path.substring(0, s) + "/#" + path.substring(s);
            }

console.log("[" + dd + "] href: \"" + hh + "\" -> \"" + href + "\", path: \"" + pp + "\" -> \"" + path + "\"");

            if (href.endsWith("issues"))
              return '<a href="https://github.com/jsonx-org' + path.replace("/#", "") + 'issues">' + text + '</a>';

            if (href.match(/.+\..+/)) {
              var s = path.indexOf('#/', 1);
              if (s !== -1)
                path = path.substring(0, s) + "blob/master/" + path.substring(s + 2);
              else
                path += "/blob/master";

              return '<a href="https://github.com/jsonx-org' + path + 'LICENSE.txt">' + text + '</a>';
            }

            if (isRoot)
              path = path.substring(rootPath.length);

            if (href.charAt(0) === '#')
              return '<a href="' + path + '?id=_' + href.substring(1) + '">' + text + '</a>';

            href = href.replace("/tree/master", "/#");
            if (href.charAt(0) === '/')
              href = href.substring(1);

            return '<a href="' + path + href + '">' + text + '</a>';;
          }
        }
      }
    }
